  13,\n\t\"tags\": [],\n\t\"title\": \"Chemical and physical data from Niskin bottles
  from the World Ocean Circulation Experiment and Joint Global Ocean Flux Study Hawaii
  Ocean Time-series (HOT) database during 1988-1998 in the North Pacific Ocean 100
  miles north of Oahu, Hawaii (NCEI Accession 9900208)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-08-16T00:24:56.952299\",\n\t\"name\": \"chemical-and-physical-data-from-niskin-bottles-from-the-world-ocean-circulation-experiment-and-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The HOT program makes repeated observations
  of the physics, biology and chemistry at a site approximately 100 km north of Oahu,
  Hawaii. Two stations are visited about once a month: Kahe Point (Station 1: 21.34N,
  158.27W) and Station ALOHA (Station 2: 22.75N, 158W). Various other stations are
  made intermittently in support of similar research objectives or mooring deployments.
  Samples of water column chemical analyses were collected mostly in the upper 1000m
  using Niskin bottles mounted on a rosette. The strategy was to sample at density
  horizons within the main thermocline at pressure horizons above and below this region
  (i.e., <150 dbar and >2000 dbar). Care was applied to ensure the highest possible
  accuracy and precision. Parameters included salinity, oxygen, dissolved inorganic
  carbon, titration alkalinity, pH, inorganic and organic nutrients, nitrate plus
  nitrite, dissolved total nitrogen, dissolved phosphate, dissolved silica, dissolved
  organic carbon, particulate phosphorus, adenosine 5'-triphosphate, pigments, and
  others.nnAs part of the HOT program two transect cruises (ALOHA-Climax: AC) have
  been conducted near the HOT area, from Oahu along the TOPEX line to station Climax
  (~28N, 155 20'W).nnWater samples have been obtained at station HALE-ALOHA during
  cruises conducted for retrieval and/or re-deployment of the bottom-moored buoy.
  These casts are used for calibration of the sensors attached to the mooring.\",\n\t\"license_title\":
